import {React} from "react";
import {Accordion, AccordionDetails, AccordionSummary, Typography} from "@mui/material";
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import './LinkPicker.css'

export function LinkPicker() {
    return (
        <div style={{padding: `5px 50px`}}>
            <h2 style={{textAlign: `center`}}>Link picker</h2>
            <div>
                <Accordion>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1a-content"
                        id="panel1a-header"
                    >
                        <Typography>Metro</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <div><input type={"checkbox"}/> Select All</div> <br/>
                        <div class="row">
                            <div className="column">A <input type={"checkbox"}/></div>
                            <div className="column">B <input type={"checkbox"}/></div>
                            <div className="column">C <input type={"checkbox"}/></div>
                        </div>
                    </AccordionDetails>
                </Accordion>
            </div>
        </div>
    );


}
